import { useNavigate } from "react-router-dom";
import { useState } from "react";

export default function Home() {
  const navigate = useNavigate();
  const [city, setCity] = useState("");

  const handleSearchClick = () => {
    if (city) {
      navigate(`/hotels/${city}`);
    } else {
      alert("Please select a city.");
    }
  };

  return (
    <div className="min-h-screen flex flex-col">
      {/* Navbar */}
      <header className="flex justify-between items-center bg-blue-900 px-8 py-4 text-white">
        <h1 className="text-2xl font-bold">Booking.com</h1>
        <nav className="flex items-center gap-4">
          <span className="font-bold">INR</span>
          <img src="https://t-cf.bstatic.com/design-assets/assets/v3.109.0/images-flags/In@3x.png" alt="India Flag" className="w-6 h-6 rounded-full"/>
          <button className="hover:underline">List your property</button>
          <button onClick={() => navigate("/register")} className="bg-white text-blue-900 px-3 py-1 rounded hover:bg-gray-200">Register</button>
          <button onClick={() => navigate("/login")} className="bg-white text-blue-900 px-3 py-1 rounded hover:bg-gray-200">Sign in</button>
        </nav>
      </header>

      {/* Hero Section */}
      <div className="relative h-[500px] bg-cover bg-center flex flex-col items-center justify-start text-white pt-20" style={{ backgroundImage: "url('https://images.unsplash.com/photo-1562832133-b90379998e14?auto=format&fit=crop&w=1600&h=600&q=80')" }}>
        <div className="relative z-10 flex flex-col items-start px-4">
          <h2 className="text-5xl font-bold mb-3">Search hotels in Hyderabad</h2>
          <p className="mb-6 text-lg">Enter your dates to see the latest prices and deals for Hyderabad hotels</p>

          <div className="bg-yellow-400 p-1 rounded-lg flex flex-wrap gap-px justify-center w-full max-w-4xl shadow-lg">
            <select className="bg-white border-none p-3 rounded-l-md w-full md:w-1/4" value={city} onChange={(e) => setCity(e.target.value)}>
              <option value="">Where are you going?</option>
              <option value="Hyderabad">Hyderabad</option>
              <option value="Vijayawada">Vijayawada</option>
              <option value="Vizag">Vizag</option>
            </select>
            <input type="text" placeholder="Check-in date — Check-out date" onFocus={(e) => e.target.type='date'} onBlur={(e) => e.target.type='text'} className="bg-white border-none p-3 w-full md:w-1/4" />
            <select className="bg-white border-none p-3 w-full md:w-1/4">
              <option>2 adults · 0 children · 1 room</option>
              <option>1 adult · 0 children · 1 room</option>
              <option>3 adults · 1 child · 2 rooms</option>
            </select>
            <button onClick={handleSearchClick} className="bg-blue-600 text-white px-8 py-3 rounded-r-md font-semibold hover:bg-blue-700 w-full md:w-auto">Search</button>
          </div>
           <div className="mt-4">
            <label className="flex items-center gap-2">
              <input type="checkbox" className="w-5 h-5" />
              I'm travelling for work
            </label>
          </div>
        </div>
      </div>

      {/* Explore Cities */}
      <section className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6 p-8 bg-white">
        {[
          { city: "Hyderabad", img: "https://wallpaperaccess.com/full/2142440.jpg" },
          { city: "Vijayawada", img: "https://wallpaperaccess.com/full/1992125.jpg" },
          { city: "Vizag", img: "https://wallpapercave.com/wp/wp11030879.jpg" }
        ].map(place => (
          <div key={place.city} className="relative rounded-lg shadow-lg hover:scale-105 transform transition cursor-pointer overflow-hidden h-72 group" onClick={() => navigate(`/hotels/${place.city}`)}>
            <img src={place.img} alt={place.city} className="w-full h-full object-cover" />
            <div className="absolute inset-0 bg-black bg-opacity-30"></div>
            <h3 className="absolute bottom-4 left-4 text-white text-2xl font-bold">{place.city}</h3>
            <button className="absolute top-4 right-4 bg-blue-600 text-white py-2 px-4 rounded opacity-0 group-hover:opacity-100 transition-opacity">Explore</button>
          </div>
        ))}
      </section>

      {/* Footer */}
      <footer className="bg-blue-900 text-white text-center py-4 mt-auto">
        © 2025 Booking.com. All rights reserved.
      </footer>
    </div>
  );
}
